function UpdateForm({
    formName, 
    handleSubmit,
    handleChange
}){
    return (
        <div>
            <p>{formName}</p>
            <form onSubmit={handleSubmit}>
                 {children}
            </form>
        </div>
    )
}

export default UpdateForm
